import { useState, useEffect } from "react";
import axios from "axios";
import {
  Card,
  CardHeader,
  CardBody,
  Container,
  Row,
  Col,
  Button,
  Form,
  FormGroup,
  Label,
  Input,
  Alert,
  Badge,
  Table,
  UncontrolledCollapse,
  ListGroup,
  ListGroupItem
} from "reactstrap";
import Header from "components/Headers/Header.js";

const API_URL = "http://localhost:5000/api/ai-sparql";
const PROGRAMS_URL = "http://localhost:5000/api/health-programs";

const AISparql = () => {
  const [prompt, setPrompt] = useState("");
  const [loading, setLoading] = useState(false);
  const [result, setResult] = useState(null);
  const [error, setError] = useState("");
  const [success, setSuccess] = useState("");
  
  // Ã‰tat de configuration
  const [apiConfig, setApiConfig] = useState(null);
  
  // DonnÃ©es pour les actions intelligentes
  const [users, setUsers] = useState([]);
  const [programs, setPrograms] = useState([]);
  const [suggestions, setSuggestions] = useState([]);
  
  // Action intelligente
  const [smartAction, setSmartAction] = useState({
    action: "assign_program",
    programId: "",
    userId: "",
    newUserId: "",
    type: "Activity",
    name: "",
    description: "",
    duration: "",
    creatorId: "admin"
  });

  useEffect(() => {
    fetchConfig();
    fetchUsers();
    fetchPrograms();
    fetchSuggestions();
  }, []);

  const fetchConfig = async () => {
    try {
      const response = await axios.get(`${API_URL}/config`);
      if (response.data.success) {
        setApiConfig(response.data);
      }
    } catch (err) {
      console.error("Failed to fetch config:", err);
    }
  };

  const fetchUsers = async () => {
    try {
      const response = await axios.get(`${PROGRAMS_URL}/relations/users`);
      if (response.data.success) {
        setUsers(response.data.users);
      }
    } catch (err) {
      console.error("Failed to fetch users:", err);
    }
  };

  const fetchPrograms = async () => {
    try {
      const response = await axios.get(`${PROGRAMS_URL}/all`);
      if (response.data.success) {
        setPrograms(response.data.programs);
      }
    } catch (err) {
      console.error("Failed to fetch programs:", err);
    }
  };

  const fetchSuggestions = async () => {
    try {
      const response = await axios.get(`${API_URL}/suggestions`);
      if (response.data.success) {
        setSuggestions(response.data.suggestions);
      }
    } catch (err) {
      console.error("Failed to fetch suggestions:", err);
    }
  };

  const handleGenerateQuery = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError("");
    setSuccess("");
    setResult(null);

    try {
      const response = await axios.post(`${API_URL}/generate`, {
        prompt,
        executeQuery: true
      });

      if (response.data.success) {
        setResult(response.data);
        setSuccess("âœ… RequÃªte gÃ©nÃ©rÃ©e et exÃ©cutÃ©e avec succÃ¨s !");
        
        // RafraÃ®chir les programmes si c'Ã©tait une modification
